import React from 'react';
import {HeaderContainer, LogoContainer, DirectoryContainer, DirectoryLink} from './header.styles';
import {ReactComponent as Logo} from '../../assets/crown.svg';
//TODO replace with actual site svg


const Header = () => {
    return <HeaderContainer>
        <LogoContainer to="/">
            <Logo/>
        </LogoContainer>
        <DirectoryContainer>
            <DirectoryLink>Donate Now</DirectoryLink>
            <DirectoryLink>Learn About Our Cause</DirectoryLink>
        </DirectoryContainer>
    </HeaderContainer>
}

export default Header;


